let globalId = 10

const handlerFunctions = {

    sendCarData: (req, res) => {
        res.send(cars)
    },

    editCar: (req, res) => {
        const {id} = req.params
        const {year, make, model, mileage, engineSize} = req.body

        const idx = cars.findIndex(car => car.id === +id)
        const carTarget = cars[idx]
        console.log(idx)
        console.log(carTarget)
        carTarget.year = +year
        carTarget.make = make
        carTarget.model = model
        carTarget.mileage = +mileage
        carTarget.engineSize = +engineSize
        
        res.send(carTarget)
    },

    addCar: (req, res) => {

        const newCar = {
            img: "",
            id: globalId,
            year: '',
            make: 'New car',
            model: '',
            mileage: '',
            engineSize: '',
        }

        cars.push(newCar)

        globalId ++

        res.send(newCar)
    },

    deleteCar: (req, res) => {
        const id = req.params.id

        cars = cars.filter((car) => car.id != id)

        res.send(cars)
    }

}

export default handlerFunctions